			var dataLabels = [];
			var dataFinal = [];
			var canvas;
			var ctx;
			
			var graphWidth = 0.7;
			var graphHeight = 0.6;



			

			//write to the canvas
			function setup() {
				canvas = theOnlyCanvas;
				ctx = canvas.getContext("2d");

				parse();
				draw();
			}

			function parse() {
				//parse the data
				data = data.split("\n");
				dataLabels = data.shift();

				//create 2d array
				dataFinal = data.map(a => a.split(","));

				//remove IDs and position data, they're useless
				dataFinal.forEach(a => {
					a.splice(0, 3);
				});

				//remove any non-stars
				dataFinal = dataFinal.filter(a => a[10] == `"STAR"`);

				//normalize color data
				var slices = [
					dataFinal.map(a => +a[0]),
					dataFinal.map(a => +a[1]),
					dataFinal.map(a => +a[2]),
					dataFinal.map(a => +a[3]),
					dataFinal.map(a => +a[4]),

				]
				var mins = [
					Math.min(...slices[0]),
					Math.min(...slices[1]),
					Math.min(...slices[2]),
					Math.min(...slices[3]),
					Math.min(...slices[4]),
				];
				var maxs = [
					Math.max(...slices[0]),
					Math.max(...slices[1]),
					Math.max(...slices[2]),
					Math.max(...slices[3]),
					Math.max(...slices[4]),
				];
				dataFinal.forEach(s => {
					s[0] = getPercentage(mins[0], maxs[0], +s[0]);
					s[1] = getPercentage(mins[1], maxs[1], +s[1]);
					s[2] = getPercentage(mins[2], maxs[2], +s[2]);
					s[3] = getPercentage(mins[3], maxs[3], +s[3]);
					s[4] = getPercentage(mins[4], maxs[4], +s[4]);
				})
			}

			function draw() {
				//bg
				ctx.fillStyle = "#222222";
				ctx.fillRect(0, 0, canvas.width, canvas.height);

				//from highest to lowest frequency, goes u -> g -> r -> i -> z
				//u is technically ultraviolet, but it encompasses the blue band as well so we count it

				//I kind of wonder what will happen if I just add up all the values and display that
				var bins = 10;
				var sums = [0, 0, 0, 0, 0];
				var sumCs = ["#808", "#4F4", "#F00", "#800", "#888"];

				dataFinal.forEach(s => {
					sums[0] += +s[0];
					sums[1] += +s[1];
					sums[2] += +s[2];
					sums[3] += +s[3];
					sums[4] += +s[4];
				})

				var absMax = Math.max(...sums);
				var absMin = 0;
				console.log(sums);


				var dx = canvas.width * graphWidth / (sums.length - 1);
				var dy = canvas.height * graphHeight;
				var baseX = canvas.width * 0.5 * (1 - graphWidth);
				var baseY = canvas.height * 0.5 * (1 + graphHeight);

				for (var b=0; b<sums.length; b++) {
					drawLine(baseX + dx * b, baseY, baseX + dx * b, linterp(baseY, baseY - dy, getPercentage(absMin, absMax, sums[b])), sumCs[b]);
				}
			}

			function drawCircle(x, y, r, color) {
				ctx.fillStyle = color;
				ctx.beginPath();
				ctx.ellipse(x, y, r, r, 0, 0, Math.PI * 2, false);
				ctx.fill();
			}

			function drawLine(x1, y1, x2, y2, color) {
				ctx.strokeStyle = color;
				ctx.lineWidth = 10;
				ctx.beginPath();
				ctx.moveTo(x1, y1);
				ctx.lineTo(x2, y2);
				ctx.stroke();

			}

			window.onload = setup;
